import { HomePage } from "../Pages/HomePage";
import { MainLayout } from "../Layouts/MainLayout";

export const router = createBrowserRouter([
  {
    path: "/",
    element: <h1>Ana sehife</h1>,
  },
  {
    path: "/products",
    element: <MainLayout />,
    children: [
      {
        index: true,
        element: <HomePage />,
      },
      {
        path: "/tasks",
        element: <h1>Tasks</h1>,
      },

    ],
  },
  {
    path: "/contact",
    element: <h1>Contact</h1>,
  }
]);
